import React, { Fragment } from 'react'

const PopularRestaurant:React.FC<{name:string, chef:string, image:string}> = (props) => {
  return (
    <Fragment>
        <li>{props.name}</li>
        <li>{props.chef}</li>
        <li>{props.image}</li>
    </Fragment>
  )
}

export default PopularRestaurant
